let maxN = 1;
let depth = 0;
let curN = 7;

$(() => {
    $("#h5CurN").text($("#h5CurN").text() + curN);
    displayCases();
});

function displayCases() {
    for (let c of kpCases) {
        let kpCase = c.split(";")[0];
        let affixes = c.split(";")[1]
        
        if (!kps[kpCase]) {
            kps[kpCase] = [];
        }

        kps[kpCase].push(affixes);
    }

    for (let k of Object.keys(kps)) {
        kps[k] = [...new Set(kps[k])];
    }
    kps = sortOps(kps);

    let out = "<button onclick=\"downloadFile()\">Download</button>";

    for (let i = 0; i < Object.keys(kps).length; i++) {
        out += "<h1 style=\"text-align: left;\">" + Object.keys(kps)[i] + ":</h1><br><div style=\"display: grid; grid-template-columns: 1fr 1fr;\"><svg id=\"svgScramble" + i + "\"></svg><div id=\"scramble" + i + "\" style=\"height: 25vh; overflow-y: scroll;\"></div></div><br><br>";
    }

    $("#scrambleDiv").html(out);
    
    for (let i = 0; i < Object.keys(kps).length; i++) {
        let alg = Object.values(kps)[i][0];
        for (let j = 0; j < Object.values(kps)[i].length; j++) {
            let ks = Object.values(kps)[i][j];
            $("#scramble" + i).append("<h2>" + (j + 1) + ". " + ks + "</h2>");
        }
        drawScrambleNxN("#svgScramble" + i, 4, inverseAlg(alg.replaceAll("(", "").replaceAll(")", "").replaceAll("[KP]", kp)), ["white", "gray", "gray", "gray", "gray", "gray"]);
    }
    
    if (Object.keys(kps).length === 0) {
        $("#scrambleDiv").append("No algs found with the chosen N");
    }
}

function sortOps(ops) {
    let nOps = {};

    for (let k of Object.keys(ops)) {
        let arr = ops[k].sort((a, b) => {
            return getAlgScore(a) - getAlgScore(b);
        });
        nOps[k] = arr;
    }

    return nOps;
}

function getAlgScore(alg) {
    let sum = 0;

    for (let m of alg.split(" ")) {
        let p = 0;

        if (m.includes("R") || m.includes("U")) {
            p += 1;
        }
        else if (m.includes("F") || m.includes("D")) {
            p += 2;
        }
        if (m.includes("2")) {
            p *= 2;
        }

        sum += p;
    }

    return sum;
}

function downloadFile() {
    const link = document.createElement("a");
    const content = JSON.stringify(kps);
    const file = new Blob([content], { type: 'text/plain' });
    link.href = URL.createObjectURL(file);
    link.download = "kpAlgs_" + curN + ".txt";
    link.click();
    URL.revokeObjectURL(link.href);
};

